import React, { useContext, useEffect, useState } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import { UserContext } from "../context/UserProvider";
import GeneralClasification from "../components/GeneralClasification";
import JornadasClasification from "../components/JornadasClasification";

const Home = () => {
  const { getGeneralClasification, getWeeklyClasification } = useContext(UserContext);
  const [generalClasification, setGeneralClasification] = useState([]);
  const [weeklyClasification, setWeeklyClasification] = useState([]);

  const fetchData = async () => {
    // GENERAL
    let teamsGeneral = await getGeneralClasification();
    setGeneralClasification(teamsGeneral);

    // WEEKLY
    let teamsWeekly = await getWeeklyClasification();
    setWeeklyClasification(teamsWeekly);
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="pageBackground">
      <Header />
      <div className="tableContainer">
        <GeneralClasification teams={generalClasification} />
        <JornadasClasification teams={weeklyClasification} />
      </div>
      <Footer />
    </div>
  );
};

export default Home;
